description:
Her husband was killed in a mysterious accident, Silvia is exposed to persecution of Mr. Barrio, a neighboring landowner who, citing debts allegedly contracted the deceased, not only wants to force her to pay a huge sum but also to give him. Convinced that Barrio is responsible for the death of her husband, Silvia calls for help Benito, a colossus in love with her. For its part, Barrio contacts Frankie, a mafioso lover of his sister, for his assistance, if necessary by force, to compel, to submit Silvia...

